DROP DATABASE IF EXISTS db_app10;
CREATE DATABASE IF NOT EXISTS db_app10;
USE db_app10;

DROP TABLE IF EXISTS tbl_user;
CREATE TABLE IF NOT EXISTS tbl_user (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20)
);
COMMIT;

SELECT id, first_name, last_name, email, gender, ip_address
  FROM tbl_user
 ORDER BY id DESC
 LIMIT 0, 20; -- 1
 -- LIMIT 20, 20; --2
 -- LIMIT 40, 20; --3